import { useState } from 'react'
import reactLogo from './assets/react.svg'
import viteLogo from '/vite.svg'
import './App.css'

// MUI imports
import { TextField, Avatar } from '@mui/material';

const DUMMY_USERS = [
  { fullName: "Yossef Sabag", url: "data:image/jpeg;base64," },
  { fullName: "Elchanan Chen", url: "" },
  { fullName: "Eden Shabi", url: "data:image/png;base64," }
]

const getInitials = (fullName) => {
  const words = fullName.split(" ");
  let initials = '';
  for(let i = 0; i < words.length; i++){
    initials += words[i][0];
  }
  console.log(fullName, "initials:", initials);
}

function App() {

  return (
    <>
      <div>
        {DUMMY_USERS.map( user => {
          getInitials(user.fullName);
          return <div key={user.fullName}>
            <Avatar src={user.url} />
            <div>{user.fullName}</div>
          </div>
        })}
      </div>
      <TextField id="outlined-basic" label="Outshined" variant="outlined" />
    </>
  )
}

export default App
